Answer the following question based on the information in the given passage. Passage: The Po (/poʊ/, Italian:[ˈpɔ]; Latin: Padus or Ēridanus; Ancient Greek: Πάδος, romanized:Pádos or Ἠριδανός, Ēridanós; Ancient Ligurian: Bodincus or Bodencus) is a river that flows eastward across northern Italy. The Po flows either 652km (405mi) or 682km (424mi) – considering the length of the Maira, a right bank tributary. The headwaters of the Po are a spring seeping from a stony hillside at Pian del Re, a flat place at the head of the Val Po under the northwest face of Monviso (in the Cottian Alps). The Po ends at a delta projecting into the Adriatic Sea near Venice. It has a drainage area of 74,000km² in all, 70,000 in Italy, of which 41,000 is in montane environments and 29,000 on the plain.[2] The Po is the longest river in Italy; at its widest point its width is 503m (1,650ft).[1] The Po extends along the 45th parallel north. Question: How long is the Po river in Italy? Answer: The Po river in Italy is 652km (405mi) or 682km (424mi) long.

